INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "お！\nあそこに困ってそうな人発見！", "春咲 ひより", 0, 1, 0, 1.4, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 2, 1001, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "大切な人を\n守れるようになりたい…って", "草野 優衣", 0, 1, 0, 1.4, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 2, 1002, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "キミに必要な集中力と感性が", "士条 怜", 0, 1, 0, 1.4, 1, 0, "フェンシングを始めてみては？", 0, 2, 1003, 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "今日はなにして遊ぶ？", "穂高 みそぎ", 0, 1, 0, 1.5, 1, 0, "ねぇ、にいちゃん！", 0, 2, 1004, 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "ねぇ…", "風宮 あかり", 0, 1, 0, 1.4, 1, 0, "風宮あかりです", 0, 2, 1006, 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "プリンたべたいのー", "出雲 宮子", 0, 1, 0, 1.5, 1, 0, "出雲宮子なのー", 0, 2, 1007, 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", 0, 1, 0, 1.4, 1, 0, "ボクは虹村雪。", 0, 2, 1008, 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", 0, 1, 0, 1.4, 1, 0, "フッ…聞いて後悔するがいい！", 0, 2, 1009, 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", 0, 1, 0, 1.5, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 2, 1010, 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", 0, 1, 0, 1.4, 1, 0, "衣之咲璃乃です！", 0, 2, 1011, 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "ち、超能力って…\n何のことかな～？", "柏崎 初音", 0, 1, 0, 1.4, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 2, 1012, 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "一応カリスマ読モJKやってまっす！", "美波 鈴奈", 0, 1, 0, 1.4, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 2, 1016, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "東京は遊園地みたいなところさー", "喜屋武 香織", 0, 1, 0, 1.4, 1, 0, "はいたーい。\n喜屋武香織さー。", 0, 2, 1017, 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "先生って呼ばれるのは\nくすぐったいから", "支倉 伊緒", 0, 1, 0, 1.4, 1, 0, "支倉伊緒です。", 0, 2, 1018, 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "あ！/\お兄ちゃ～ん\nまってよ～", "茜 ミミ", 0, 1, 0, 1.5, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 2, 1020, 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "あの……\nふぇ……", "栗林 くるみ", 0, 1, 0, 1.5, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 2, 1021, 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "こんな私に貴重な時間を\n割いていただき、", "風宮 より", 0, 1, 0, 1.4, 1, 0, "風宮よりです。\nあああああ！", 0, 2, 1022, 0, "なんてありがとうございます！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "おにいちゃんどこいくの？\nえ？", "北条 綾音", 0, 1, 0, 1.5, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 2, 1023, 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "ふ、不束者ですが\nどうぞ末永く…って、", "天野 すずめ", 0, 1, 0, 1.4, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 2, 1025, 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "あなたは…運命の……\n伴侶……", "倉石 恵理子", 0, 1, 0, 1.4, 1, 0, "……クスクス…私は\n…倉石恵理子……", 0, 2, 1027, 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", 0, 1, 0, 1.4, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 2, 1028, 0, "…そうでしょ？？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", 0, 1, 0, 1.4, 1, 0, "桜井望だよ！\nよろしくねっ", 0, 2, 1029, 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "初めまして、\n私はニノン・ジュベール申すデス！", "ニノン・ジュベール", 0, 1, 0, 1.4, 1, 0, "デケデケデンっ！", 0, 2, 1030, 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "でもって私の隣にいるのが……\nえ、見えない？", "上喜 しのぶ", 0, 1, 0, 1.4, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 2, 1031, 0, "おかしいですね……");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "けんども\nそれには足りないモンが…", "野戸まひる", 0, 1, 0, 1.5, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 2, 1033, 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "ちょっと緊張しちゃって…", "綾瀬 ゆかり", 0, 1, 0, 1.4, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 2, 1034, 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "知らない人とは話しちゃいけないので", "氷川 鏡華", 0, 1, 0, 1.5, 1, 0, "氷川鏡華…です", 0, 2, 1036, 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "……あ、アラーム。", "柏崎 栞", 0, 1, 0, 1.4, 1, 0, "柏崎…栞です。", 0, 2, 1038, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "私、一人も友達がいなくて……", "双葉 碧", 0, 1, 0, 1.4, 1, 0, "ふ、双葉碧です。", 0, 2, 1040, 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角 千歌", 0, 1, 0, 1.4, 1, 0, "三角千歌です。", 0, 2, 1042, 0, "そう思っています。");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "あぁ？\nお前のそいつの仲間か？", "安芸 真琴", 0, 1, 0, 1.4, 1, 0, "安芸真琴だ。", 0, 2, 1043, 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "生けとし生ける全ての者よ！", "イリヤ・オーンスタイン", 0, 1, 0, 1.4, 1, 0, "わらわこそは夜を総べる者！", 0, 2, 1044, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "ぐふふふふ……はっ！", "遠見 空花", 0, 1, 0, 1.4, 1, 0, "そこで騎士は妖精を乱暴に……", 0, 2, 1045, 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまき", 0, 1, 0, 1.4, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 2, 1046, 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "それでは早速クエストに…", "大神 美冬", 0, 1, 0, 1.4, 1, 0, "大神美冬よ！", 0, 2, 1048, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "クエストもバトルも\n掃除も洗濯も", "星野静流", 0, 1, 0, 1.4, 1, 0, "星野静流だよ！", 0, 2, 1049, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "見ての通りの\nセクシー美少女で", "玉泉美咲", 0, 1, 0, 1.5, 1, 0, "アタシは玉泉美咲。", 0, 2, 1050, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "？？？？", "リマ", 0, 1, 0, 1.4, 1, 0, "？？？", 0, 2, 1052, 0, "？？？？");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィント", 0, 1, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1053, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", "ペコリーヌ", 0, 1, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1058, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", "コッコロ", 0, 1, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1059, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", "キャル", 0, 1, 0, 1.5, 1, 0, "モニカ・ヴァイスヴィントだ。", 0, 2, 1060, 0, "そ、そこまでいうなら\nもらってやる");
